\begin{align*}
p(x) &= a(x - (4 - \sqrt{11}))(x - (4 + \sqrt{11}))\\
&= a(x^2 - (4 + \sqrt{11} + 4 - \sqrt{11})x + (4 - \sqrt{11})(4 + \sqrt{11}))\\
&= a(x^2 - 8x + (4^2 - (\sqrt{11})^2))\\
&= a(x^2 - 8x + 12)
\end{align*}

Step 3: Calculate $p(3)$ and $p(4)$.
\begin{align*}
p(3) &= a(3^2 - 8(3) + 12)\\
&= a(9 - 24 + 12)\\
&= a(-3)\\
p(3) &= -3a
\end{align*}

\begin{align*}
p(4) &= a(4^2 - 8(4) + 12)\\
&= a(16 - 32 + 12)\\
&= a(4)\\
p(4) &= 4a
\end{align*}

Step 4: Calculate $\frac{p(3)}{p(4)}$.
\begin{align*}
\frac{p(3)}{p(4)} &= \frac{-3a}{4a}\\
&= -\frac{3}{4}
\end{align*}

Final Answer: 
The final answer is: $\boxed{-\frac{3}{4}}$"

